import Skills from "./Skills";
import { DiPhotoshop } from 'react-icons/fa';
import { BiLogoCss3 } from 'react-icons/fa';
import { BiLogoJavascript } from 'react-icons/fa';


export default function SkillsList( { heading } ) { 

    const skillist = [
        {
            icon : DiPhotoshop,
            skill : "Photoshop"
        },
        {
            icon : BiLogoCss3,
            skill : "CSS3"
        },
        {
            icon : BiLogoJavascript,
            skill : "Javacript"
        },
    ]

    return (
        <div>
            <h2>{heading}</h2>
            <Skills skills={skillist} />
        </div>
    )
 }
